    # n is divisible by 15

    def remove_divisors(x):
        while x % 2 == 0:
            x //= 2
        while x % 3 == 0:
            x //= 3
        while x % 5 == 0:
            x //= 5
        return x

    def find_divisors(x):
        x //= remove_divisors(x)
        while x % 2 == 0:
            x //= 2
        while x % 3 == 0:
            x //= 3
        while x % 5 == 0:
            x //= 5
        return x

    def solve(nums):
        if len(nums) == 1:
            return nums[0]
        # find the largest divisor
        divisors = sorted(nums, key=find_divisors)
        # find the smallest number of the largest divisors
        if nums[0] > divisors[-1]:
            nums[0], nums[-1] = nums[-1], nums[0]
        # replace the small divisors with the largest ones
        for i in range(1, len(nums)):
            if nums[i] > nums[i-1]:
                nums[i], nums[i-1] = nums[i-1], nums[i]
        # find the smallest number of the largest divisors
